import React from 'react'
import MainContent from './MainContent'

const EditExam = () => {
  const text ={
    header:"Exam-Topic-Mapping",
    btnText:"Topic to Exam "
   }
  return (
    <><MainContent text={text} to="Topic to Exam" back="/admin/exam/edit/"/>
    </>
  )
}

export default EditExam
